export class CarteTransfusionnellePatient
{
    PatientId:number;
    Abo:string;
    Rhesus:string;
    PhenotypeC:string;
    PhenotypeE:string;
    Kell:string;
    constructor()
    {
        this.PatientId=0;
        this.Abo='';
        this.Rhesus='';
        this.PhenotypeC='';
        this.PhenotypeE='';
        this.Kell='';
    }
}
